import React from "react";
import Header from "../Header/Header";
import bg from "../../Assets/medicalBG.png";
import "./Home.css";
function Home() {
  return (
    <>
      <Header />
      <div className="home">
        <img src={bg} alt="bg"></img>
        <div className="home__container"></div>
      </div>
    </>
  );
}
export default Home;
